-- create database albany
CREATE DATABASE IF NOT EXISTS albany;
USE albany;

-- FINAL
DROP TABLE IF EXISTS final ;
CREATE TABLE final (
     Agency VARCHAR(255),
     RouteID INT,
     RouteName VARCHAR(255),
      StopID VARCHAR(255),
     StopName VARCHAR(255),
     StopLat NUMERIC(20,16),
     StopLog NUMERIC(20,16),
     StopDes VARCHAR(255),
     LocationType VARCHAR(255),
     StopSequence INT,
     DirectionID INT,
	 Trip_Headsign VARCHAR(255),
     PRIMARY KEY (Agency, RouteID, STOPID, StopSequence,Trip_Headsign )
);

 CREATE TABLE cdta (
     RouteID INT,
     RouteName VARCHAR(255),
     DirectionID INT,
	 Trip_Headsign Varchar(255),
     StopSequence INT,
     StopID VARCHAR(255),
     StopName VARCHAR(255),
     Stop_Name VARCHAR(255),
     StopLat NUMERIC(20,16),
     StopLog NUMERIC(20,16),
     LocationType INT,
    PRIMARY KEY ( RouteID, RouteName, Trip_Headsign, StopSequence, StopID)
);
 

